import "react-image-gallery/styles/css/image-gallery.css";
// import b1 from '../../../../../images/berets/b1.jpg'


const PREFIX_URL = 'https://az1.hatstoremedia.com/hatstore/images/';

class Beret1Gallery extends React.Component {
  render() {
    return (<div >
      <ImageGallery {... (
        {
          thumbnailPosition: "left",
          useBrowserFullscreen: true,
          showPlayButton: true,
          showIndex: true,
          height: "400px",
          width: "400px",


          items: [
            {
              original: `${PREFIX_URL}4062845093940_2/652/522/0/viscose-mix-black-beret-seeberger.jpg`,
              thumbnail: `${PREFIX_URL}4062845093940_2/90/90/0/viscose-mix-black-beret-seeberger.jpg`,
            },
            {
              original: '../b1.jpg',
              thumbnail: '../../images/beretsb1a.jpg',
            },
          ]

        })} />
    </div>);
  }
}
export default Beret1Gallery;
